import React from 'react';
import Navigation from "./Navigation";
import Vegan from "./Vegan";
import ItemDetail from './ItemDetail';
import {BrowserRouter as Router, Switch, Route, NavLink as Link} from 'react-router-dom';
import About from './About';
import './App.css';
import './assets/css/main.css';

//function component const example = (props) => { return <div /> }
const App = () => {

  return (
    <Router>
    <div className="App">
      <Navigation/>
      <Switch>
        <Route path="/" exact component={App} />
        <Route path="/about" component={About} />
        <Route path="/vegan" component={Vegan} />
        {/* 
        <Route path="/healthy" component={Healthy} />
        /<Route path="/baking" component={Baking} />
        /<Route path="/christmas" component={Christmas} /> 
        */}
        <Route path="/recipe/:id" component={ItemDetail} />
      </Switch>
      <head>
        <title>Forty by HTML5 UP</title>
        <meta charset="utf-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1, user-scalable=no" />
        <link rel="stylesheet" href="assets/css/main.css" />
        <noscript><link rel="stylesheet" href="assets/css/noscript.css" /></noscript>
      </head>
	<body class="is-preload">
			
      </body>
    </div>
    </Router>
  );
 
}

export default App;
